  return (
    <div className="App">
        <Image src={sw} centered/>

      <Button as='div' labelPosition='right' style={{marginLeft:"400px"}}>
      <Button color='red'>
        <Icon name='heart' />
        Like
      </Button>
      <Label as='a' basic color='red' pointing='left'>
        2,048
      </Label>
      </Button>
      <Divider horizontal>
        <Icon name='comment alternate' />
          후기
      </Divider>
      <Comments/>
      {/* <SingleComment/> */}
    </div>
  );
}

export default App;
